
var close=document.getElementsByClassName("clouse");var ii;for(ii=0;ii<close.length;ii++){close[ii].onclick=function(){this.parentElement.style.display="none";this.parentElement.style.visibility="hidden"}}if(document.getElementById("uploadBtn")){document.getElementById("uploadBtn").onchange=function(){var b;var d=document.getElementById("uploadBtn").files;if(d.length!=false){var c="<br/><small><strong>Chosen files: </strong>";for(b=0;b<d.length;++b){var a=d.item(b).name;c=c+"<br/>"+a}}else{var c="<br/><strong>Chosen files: </strong><br/>No file chosen"}document.getElementById("noChosen").innerHTML=c+"</small><br/>"}};